import React from 'react';
import "./Header.css";
import AccountBoxIcon from '@mui/icons-material/AccountBox';
function Header() {
    return (
        <div className="header">
            <AccountBoxIcon />
            <h2> I am Header</h2>
        </div>
    )
}
export default Header;
